def HttpLoad(args):
                                    
    se = Network.Web.sandbox.Caller(args.url, 'method')                  
    for i in range(args.count):
        acc = se.create_muid()

        se.begin_download(muid=acc.muid)
        se.begin_install(muid=acc.muid)
        se.end_install(muid=acc.muid)
            
        auid = args.start_auid+i
        se.first_login(auid=auid, muid=acc.muid)
        se.download_client_begin(auid=auid)
        se.download_client_end(auid=auid)   
        se.faction_selected(auid=auid, faction=0)
        se.castle_login(auid=auid, faction=0)   
        se.session_start(auid=auid, faction=0, pvp=True, hero='fox')   
        se.session_start(auid=auid, faction=0, pvp=False, hero='mage')   
        se.resource_change(auid=auid, source="hero_unlock", gain=False, goldchange=100, silverchange=200, perlchange=200, resource1change=300, resource2change=400, resource3change=500, goldtotal=1100, silvertotal=1200, perltotal=1200, resource1total=1300, resource2total=1400, resource3total=1500)
        se.payment(auid=auid, value=295, source='yandex', total=300)

        se.reinstall(muid=acc.muid) 
