def LocalLoad():
    debug('Local stress load test')

    import main
    import test
    import time
    import threading
    import random

    http_client = test.MockHttpClient()
    class Config2:
        ka_url = 'http://localhost:9090/v1/1233'
        db = 'queue.db'
        request_rate = 20
        flush_period = 10
        start_request_rate = 10
        rate_period = 10
    queue = main.PersistentQueue(http_client, Config2)

    class Config:
        partners = {
            'rambler' : test.Dict(code='ff'),
        }
        db = 'users.db'
        flush_period = 2.0

    config = Config()
    m = main._MarketingService(config, queue)

    class Updater:

        def __init__(self, queue, m):
            self.updateTime = time.time()
            self.queue = queue    
            self.m = m

        def Update(self):
            curTime = time.time()
            if curTime > self.updateTime:
                self.m.Update()
                self.queue.Update()
                self.updateTime = curTime + 2.0

    u = Updater(queue, m)            

    count = 100
    
    muids = []
    auids = []
    for i in range(count):
        u.Update()
        if i % 100 == 0:
            debug("Created %d users" % i)
        request = test.MockRequest()
        m.CreateMuid(request, 'rambler')
        muid = request.result['muid']
        muids.append(muid)
        auid = str(6000+i)
        auids.append(auids)

        request = test.MockRequest()
        m.BeginDownload(request, muid)

        request = test.MockRequest()
        m.BeginInstall(request, muid)

        request = test.MockRequest()
        m.EndInstall(request, muid)

        request = test.MockRequest()
        m.FirstLogin(request, muid, auid)

        request = test.MockRequest()
        m.DownloadClientBegin(request, auid)

        request = test.MockRequest()
        m.DownloadClientEnd(request, auid)

        request = test.MockRequest()
        m.SelectFaction(request, auid, '0')

        request = test.MockRequest()
        m.CastleLogin(request, auid, '0')

        request = test.MockRequest()
        m.CastleLogin(request, auid, '0')

        request = test.MockRequest()
        m.SessionStart(request, auid, '0', '1', '5')

        request = test.MockRequest()
        m.SessionStart(request, auid, '0', '0', 'fox')

        request = test.MockRequest()
        m.SessionStart(request, auid, '1', '0', '5')

        request = test.MockRequest()
        m.SessionStart(request, auid, '1', '1', '5')

        request = test.MockRequest()
        m.ChangeResource(request, auid, 'hero_unlock', 'false', '0', '300', '0', '0', '0', '0', '0', '400', '4', '5', '6', '7')

        request = test.MockRequest()
        m.ChangeResource(request, auid, 'hero_unlock', 'true', '0', '300', '0', '0', '0', '0', '0', '400', '4', '5', '6', '7')

    while True:
        index = random.randrange(0, len(auids))
        muid = muids[index]
        auid = auids[index]

        request = test.MockRequest()
        m.CastleLogin(request, auid, '0')

        request = test.MockRequest()
        m.SessionStart(request, auid, '0', '1', '5')

        request = test.MockRequest()
        m.ChangeResource(request, auid, 'hero_unlock', 'false', '0', '300', '10', '20', '30', '40', '50', '400', '46', '65', '66', '67')

    thread.Stop()        

